import React, { Component } from "react";
import Button from "@material-ui/core/Button";

class UserForm extends Component {
  constructor(props) {
    super(props);
  }

  displayConsole() {
    console.log("This works?");
  }
  render() {
    return (
      <div>
        <h1>Hey look there is a cool button below.</h1>
        <Button
          color="#0063cc"
          variant="contained"
          onClick={() => this.displayConsole()}
        >
          Hi, I am a cool button
        </Button>
      </div>
    );
  }
}

export default UserForm;
